// src/App.js
// Complete Seattle Customer Service Dashboard with 2025 Tracking Data

import React, { useState, useEffect } from 'react';
import { 
  LayoutDashboard, 
  Activity, 
  Search, 
  MessageSquare, 
  Mic, 
  Lightbulb,
  Menu,
  X
} from 'lucide-react';

// Import your components
import Dashboard from './components/Dashboard';
import StatusTracker from './components/StatusTracker';
import TrackingDataViewer2025 from './components/TrackingDataViewer2025';
import Chatbot from './components/Chatbot';
import VoiceMode from './components/VoiceMode';
import DeepInsights from './components/DeepInsights';

function App() {
  const [activeView, setActiveView] = useState('dashboard');
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
  const [dataLoaded, setDataLoaded] = useState(false);

  useEffect(() => {
    // Check if data service is available
    setDataLoaded(true);
  }, []);

  // Navigation items
  const navItems = [
    {
      id: 'dashboard',
      name: 'Dashboard',
      icon: LayoutDashboard,
      description: 'Overview & Analytics'
    },
    {
      id: 'tracking',
      name: '2025 Tracking Data',
      icon: Activity,
      description: 'Real-time Status Updates'
    },
    {
      id: 'status',
      name: 'Status Tracker',
      icon: Search,
      description: 'Track Service Requests'
    },
    {
      id: 'chatbot',
      name: 'AI Chatbot',
      icon: MessageSquare,
      description: 'Ask Questions'
    },
    {
      id: 'voice',
      name: 'Voice Mode',
      icon: Mic,
      description: 'Hands-free Access'
    },
    {
      id: 'insights',
      name: 'Deep Insights',
      icon: Lightbulb,
      description: 'AI-Powered Analysis'
    }
  ];

  const renderContent = () => {
    switch (activeView) {
      case 'dashboard':
        return <Dashboard />;
      case 'tracking':
        return <TrackingDataViewer2025 />;
      case 'status':
        return <StatusTracker />;
      case 'chatbot':
        return <Chatbot />;
      case 'voice':
        return <VoiceMode />;
      case 'insights':
        return <DeepInsights />;
      default:
        return <Dashboard />;
    }
  };

  const currentNavItem = navItems.find(item => item.id === activeView);

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Top Navigation Bar */}
      <nav className="bg-gradient-to-r from-blue-600 to-indigo-700 text-white shadow-lg sticky top-0 z-50">
        <div className="container mx-auto px-4">
          <div className="flex items-center justify-between h-16">
            {/* Logo and Title */}
            <div className="flex items-center space-x-3">
              <div className="bg-white text-blue-600 rounded-lg p-2">
                <Activity className="w-6 h-6" />
              </div>
              <div>
                <h1 className="text-xl font-bold">Seattle Customer Service</h1>
                <p className="text-xs text-blue-200">Analytics & Tracking Platform</p>
              </div>
            </div>

            {/* Desktop Navigation */}
            <div className="hidden md:flex space-x-1">
              {navItems.map(item => {
                const Icon = item.icon;
                return (
                  <button
                    key={item.id}
                    onClick={() => setActiveView(item.id)}
                    className={`px-4 py-2 rounded-lg transition-all duration-200 flex items-center space-x-2 ${
                      activeView === item.id
                        ? 'bg-white text-blue-600 shadow-md'
                        : 'text-white hover:bg-blue-500'
                    }`}
                  >
                    <Icon className="w-4 h-4" />
                    <span className="text-sm font-medium">{item.name}</span>
                  </button>
                );
              })}
            </div>

            {/* Mobile Menu Button */}
            <button
              onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
              className="md:hidden p-2 rounded-lg hover:bg-blue-500 transition"
            >
              {mobileMenuOpen ? <X className="w-6 h-6" /> : <Menu className="w-6 h-6" />}
            </button>
          </div>

          {/* Mobile Navigation Menu */}
          {mobileMenuOpen && (
            <div className="md:hidden pb-4 space-y-2">
              {navItems.map(item => {
                const Icon = item.icon;
                return (
                  <button
                    key={item.id}
                    onClick={() => {
                      setActiveView(item.id);
                      setMobileMenuOpen(false);
                    }}
